const styles = {
    li: {}
}

function TodoItem({items}) {
    return (
        <li style={styles.li}>
          <span>
              <input type='checkbox'/>
              <strong>{items.index}</strong>
              &nbsp;
              {items.title}
          </span>
            <button>&times;</button>
        </li>
    );

}

export default TodoItem;
